TRUNCATE TABLE crm_users RESTART IDENTITY;

-- Insert batch #1

-- RESET ESTABLISHMENTS PK AND SEQUENCE COUNT
SELECT MAX(id) users_max_id FROM crm_users;
SELECT nextval('crm_users_id_seq') AS crm_users_nextval;
SELECT setval('crm_users_id_seq', (SELECT MAX(id) FROM crm_users)) AS crm_users_setval;
SELECT setval('crm_users_id_seq', COALESCE((SELECT MAX(id)+1 FROM crm_users), 1), false) AS crm_users_val;
